import react, {useState} from "react";

export default function Formulario(){
  const [dia,setDia] = useState("");
  const [mes,setMes] = useState("");
  const [anio,setAnio] = useState("");

  let jul= getElementById("Juliano");
  jul.addEventListener('click', function(){
  main()
  })

  function main(){
    alert("Hola Juan Carlos")
  }

  return(
   <>
    <h2>Formulario</h2>
    <form>
    <hr/>

      <label htmlFor="dia">Dia </label>
      <input 
      type="text"
      id="dia"
      name="dia"
      value={dia}
      onChange={(e) => setDia(e.target.value)}
      />
      <label htmlFor="nombre">{dia} </label>
      <br/><br/>

      <label htmlFor="mes">Mes </label>
      <input 
      type="text"
      id="mes"
      name="mes"
      value={mes}
      onChange={(e) => setMes(e.target.value)}
      />
      <label htmlFor="nombre">{mes} </label>
      <br/><br/>

      <label htmlFor="anio">anio </label>
      <input 
      type="text"
      id="anio"
      name="anio"
      value={anio}
      onChange={(e) => setAnio(e.target.value)}
      />
      <label htmlFor="nombre">{anio} </label>
      <br/><br/>

      <button id="Juliano">Calcula Dia Juliano</button>
    </form>

   </>
  );
}
